// 根据ID，取其全值
function getAddrValueByID( id )
{
	var addstr = "";
	var pid = 0;
	if( rows[id] )
	{
		pid = rows[id].parent;
		if( rows[pid] ) {
			var ppid = rows[pid].parent;
			if( rows[ppid] ) {
				if( rows[ppid].name == rows[pid].name )
					addstr = rows[ppid].name+" - ";
				else {
					if( '中国' == rows[ppid].name )
						addstr = rows[pid].name+"-";
					else 
						addstr = rows[ppid].name+"-"+rows[pid].name+"-";
				}
			}
			else {
				if( '中国' == rows[pid].name )
					addstr = "";
				else 
					addstr = rows[pid].name+" - ";
			}
		}
		addstr = addstr + rows[id].name;
	}
	return addstr ;
}

